(6, 'Satellite Imagery', 'Utilizing satellite images for counting and monitoring wildlife populations in remote areas.', 'satellite-imagery', '2025-04-02 23:59:52', '2025-04-02 23:59:52'),
(7, 'Drone Surveys', 'Employing drones with cameras for wildlife surveys in hard-to-reach areas.', 'drone-surveys', '2025-04-02 23:59:52', '2025-04-02 23:59:52'),
(8, 'Call Counts', 'Counting animal calls, often used for bird population surveys.', 'call-counts', '2025-04-02 23:59:52', '2025-04-02 23:59:52'),
(9, 'Camera Traps', 'Automated cameras capture images/videos of passing animals. Effective for elusive species.', 'camera-traps', '2025-04-02 23:59:52', '2025-04-02 23:59:52'),
(10, 'Line Transect Sampling', 'Counting animals seen or heard while walking along fixed lines. Covers representative area samples.', 'line-transect-sampling', '2025-04-02 23:59:52', '2025-04-02 23:59:52'),
(11, 'Point Transect Sampling', 'Observers count animals from fixed points. Similar to line transects but stationary.', 'point-transect-sampling', '2025-04-02 23:59:52', '2025-04-02 23:59:52'),
(12, 'Capture-Recapture Method', 'Capturing animals, marking them, and later recapturing to estimate total population size.', 'capture-recapture-method', '2025-04-02 23:59:52', '2025-04-02 23:59:52'),
(13, 'Infrared Thermal Imaging', 'Using thermal imaging to detect wildlife, especially effective for nocturnal species or dense vegetation.', 'infrared-thermal-imaging', '2025-04-02 23:59:52', '2025-04-02 23:59:52');
